import { useRef, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  useGetAirportsQuery,
  useSearchFlightsMutation,
} from "../redux/api/airportApi";
import { useDispatch } from "react-redux";
import { setSearchResults } from "../redux/slices/searchSlice";

export default function BookingEngine() {
  const { data: airports = [], isLoading } = useGetAirportsQuery();
  const [searchFlights] = useSearchFlightsMutation();
  const [form, setForm] = useState({
    from: "",
    to: "",
    date: "",
    time: "",
    pax: 1,
  });

  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const result = await searchFlights(form).unwrap();
      console.log("Search result:", result);
      dispatch(setSearchResults({ results: result, form }));
      navigate("/results"); // redirect to results page
    } catch (err) {
      console.error("Search failed:", err);
    }
  };

  const dateRef = useRef(null);
  const timeRef = useRef(null);
  return (
    <div className="booking-engine">
      {/* Tabs */}
      <div className="booking-tabs">
        <button className="active">Fly Now</button>
        <button>Empty Leg</button>
        <button>Regional</button>
        <button>Pilgrimage</button>
      </div>

      {/* Booking Form */}
      <form id="flynow" className="booking-fields" onSubmit={handleSubmit}>
        {/* From / To */}
        <div className="booking-form-row booking-form-half">
          <div className="booking-form-col">
            <label>
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/icon-from.png`}
                alt="From"
              />
              From
            </label>
            <select
              name="from"
              value={form.from}
              onChange={handleChange}
              required
              disabled={isLoading}
            >
              <option value=""></option>
              {airports?.airports?.map((airport) => (
                <option key={airport._id} value={airport._id}>
                  {airport.name} ({airport.code})
                </option>
              ))}
            </select>
          </div>

          <div className="booking-form-col">
            <label>
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/icon-to.png`}
                alt="To"
              />
              To
            </label>
            <select
              name="to"
              value={form.to}
              onChange={handleChange}
              required
              disabled={isLoading}
            >
              <option value=""></option>
              {airports?.airports?.map((airport) => (
                <option key={airport._id} value={airport._id}>
                  {airport.name} ({airport.code})
                </option>
              ))}
            </select>
          </div>
        </div>

        {/* Date / Time */}
        <div className="booking-form-row booking-form-half">
          <div
            className="booking-form-col clickable-field"
            onClick={() => dateRef.current?.showPicker()}
          >
            <label>
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/icon-date.png`}
                alt="Date"
              />
              Date
            </label>
            <input
              type="date"
              name="date"
              ref={dateRef}
              value={form.date}
              onChange={handleChange}
              required
            />
          </div>
          <div
            className="booking-form-col clickable-field"
            onClick={() => timeRef.current?.showPicker()}
          >
            <label>
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/icon-time.png`}
                alt="Time"
              />
              Time
            </label>
            <input
              type="time"
              name="time"
              ref={timeRef}
              value={form.time}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Pax */}
        <div className="booking-form-row booking-form-full">
          <div className="booking-form-col">
            <label>
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/icon-user.png`}
                alt="Passengers"
              />
              Passengers
            </label>
            <input
              type="number"
              name="pax"
              min="1"
              value={form.pax}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Submit */}
        <div className="booking-form-button">
          <input type="submit" className="btn btn-fill" value="Search" />
        </div>
      </form>
    </div>
  );
}
